/* import specific icons */
import { faUserSecret , faBell , faSearch , faInbox} from '@fortawesome/free-solid-svg-icons'
/* import the fontawesome core */
import { library } from '@fortawesome/fontawesome-svg-core'

/* add icons to the library */
library.add(faUserSecret , faBell , faSearch , faInbox)
